def parse_music(music_string: str) -> List[int]:
    """ Input to this function is a string representing musical notes in a special ASCII format.
    Your task is to parse this string and return list of integers corresponding to how many beats does each
    not last.

    Here is a legend:
    'o' - whole note, lasts four beats
    'o|' - half note, lasts two beats
    '.|' - quater note, lasts one beat

    >>> parse_music('o o| .| o| o| .| .| .| .| o o')
    [4, 2, 1, 2, 2, 1, 1, 1, 1, 4, 4]
    """
    notes = []
    current_note = ''
    for char in music_string:
        if char == ' ':
            if current_note:
                notes.append(4 if current_note[-1] == '|' else 2)
                current_note = ''
        elif char == 'o':
            current_note += char
        elif char == '|':
            current_note += char
        elif char == 'o' or char == 'O':
            current_note += char
        elif char == '.' or char == '|':
            current_note += char
        else:
            raise ValueError("Invalid character in music string")
    if current_note:
        notes.append(4 if current_note[-1] == '|' else 2)
    return notes

def parse_music(music_string: str) -> List[int]:
    """ Input to this function is a string representing musical notes in a special ASCII format.
    Your task is to parse this string and return list of integers corresponding to how many beats does each
    not last.

    Here is a legend:
    'o' - whole note, lasts four beats
    'o|' - half note, lasts two beats
    '.|' - quater note, lasts one beat

    >>> parse_music('o o| .| o| o| .| .| .| .| o o')
    [4, 2, 1, 2, 2, 1, 1, 1, 1, 4, 4]
    """
    notes = []
    current_note = ''
    for char in music_string:
        if char in 'oO':
            current_note += char
            if char == 'o':
                notes.append(4)
            elif char == 'O':
                notes.append(4)
            elif char == '|':
                notes.append(2)
        elif char == ' ':
            if current_note:
                notes.append(1)
        elif char == '\n':
            if current_note:
                notes.append(1)
            current_note = ''
    return notes

