def find_zero(xs):
    """ xs are coefficients of a polynomial.
    find_zero find x such that poly(x) = 0.
    find_zero returns only only zero point, even if there are many.
    Moreover, find_zero only takes list xs having even number of coefficients
    and largest non zero coefficient as it guarantees
    a solution.
    """
    if len(xs) % 2 != 0:
        raise ValueError("List of coefficients should have even number of elements")
    if max(xs) == 0:
        raise ValueError("List of coefficients should have largest non-zero coefficient")
    n = len(xs) // 2
    left, right = xs[:n], xs[n:]
    while left[-1] == 0 and right[0] == 0:
        left.pop()
        right.pop(0)
    if left[-1] == 0:
        return -right[0] / left[-1]
    return -left[-1] / (right[0] - left[-1])

