def correct_bracketing(brackets):
    """ brackets is a string of "<" and ">".
    return True if every opening bracket has a corresponding closing bracket.

    >>> correct_bracketing("<")
    False
    >>> correct_bracketing("<>")
    True
    >>> correct_bracketing("<<><>>")
    True
    >>> correct_bracketing("><<>")
    False
    """
    # Use a Stack to keep track of the brackets
    stack = []
    for bracket in brackets:
        if bracket == "<":
            stack.append(bracket)
        else:
            if len(stack) == 0:
                return False
            top_bracket = stack.pop()
            if top_bracket == "{" and bracket == "}":
                continue
            elif top_bracket == "[" and bracket == "]":
                continue
            elif top_bracket == "(" and bracket == ")":
                continue
            else:
                return False
    return len(stack) == 0

